import { useEffect, useRef } from 'react';
import * as THREE from 'three';

const WaveBackground = () => {
  const containerRef = useRef(null);

  useEffect(() => {
    const container = containerRef.current;
    if (!container) return;

    // Scene setup
    const scene = new THREE.Scene();
    const camera = new THREE.PerspectiveCamera(
      75,
      window.innerWidth / (window.innerHeight * 0.5),
      0.1,
      1000
    );
    camera.position.set(0, 0, 30);
    camera.lookAt(0, 0, 0);

    const renderer = new THREE.WebGLRenderer({ 
      alpha: true, 
      antialias: true
    });
    const height = window.innerHeight * 0.5;
    renderer.setSize(window.innerWidth, height);
    renderer.setClearColor(0x000000, 0);
    container.appendChild(renderer.domElement);

    // Create flowing particle waves
    const particleLayers = [];
    const layerCount = 8;

    for (let layer = 0; layer < layerCount; layer++) {
      const particleCount = 150;
      const positions = new Float32Array(particleCount * 3);
      const sizes = new Float32Array(particleCount);
      const velocities = [];

      // Initialize particles
      for (let i = 0; i < particleCount; i++) {
        positions[i * 3] = (Math.random() - 0.5) * 80;
        positions[i * 3 + 1] = (Math.random() - 0.5) * 30 - 5;
        positions[i * 3 + 2] = -layer * 2;
        
        sizes[i] = Math.random() * 0.5 + 0.3;
        
        velocities.push({
          x: (Math.random() - 0.5) * 0.02,
          y: (Math.random() - 0.5) * 0.01,
          waveSpeed: Math.random() * 0.5 + 0.3,
          waveAmplitude: Math.random() * 2 + 1,
          offset: Math.random() * Math.PI * 2
        });
      }

      const geometry = new THREE.BufferGeometry();
      geometry.setAttribute('position', new THREE.BufferAttribute(positions, 3));
      geometry.setAttribute('size', new THREE.BufferAttribute(sizes, 1));

      // Particle material with glow
      const brightness = 1.0 - (layer * 0.1);
      const material = new THREE.PointsMaterial({
        size: 0.8,
        color: new THREE.Color(brightness, brightness, brightness),
        transparent: true,
        opacity: 0.6 - (layer * 0.05),
        blending: THREE.AdditiveBlending,
        sizeAttenuation: true
      });

      const particles = new THREE.Points(geometry, material);
      scene.add(particles);

      particleLayers.push({
        particles,
        geometry,
        velocities,
        positions,
        layer
      });
    }

    // Animation
    let time = 0;
    const animate = () => {
      requestAnimationFrame(animate);
      time += 0.016;

      particleLayers.forEach((layer) => {
        const positions = layer.positions;
        
        for (let i = 0; i < positions.length / 3; i++) {
          const velocity = layer.velocities[i];
          
          // Get current position
          let x = positions[i * 3];
          let y = positions[i * 3 + 1];
          
          // Wave motion
          const waveY = Math.sin(x * 0.1 + time * velocity.waveSpeed + velocity.offset) * velocity.waveAmplitude;
          const waveY2 = Math.cos(x * 0.15 - time * velocity.waveSpeed * 0.7) * velocity.waveAmplitude * 0.5;
          
          // Update position
          x += velocity.x;
          y += velocity.y;
          
          // Wrap around
          if (x > 40) x = -40;
          if (x < -40) x = 40;
          if (y > 15) y = -25;
          if (y < -25) y = 15;
          
          positions[i * 3] = x;
          positions[i * 3 + 1] = y + waveY + waveY2;
        }
        
        layer.geometry.attributes.position.needsUpdate = true;
      });

      renderer.render(scene, camera);
    };

    animate();

    // Handle resize
    const handleResize = () => {
      const height = window.innerHeight * 0.45;
      camera.aspect = window.innerWidth / height;
      camera.updateProjectionMatrix();
      renderer.setSize(window.innerWidth, height);
    };
    window.addEventListener('resize', handleResize);

    // Cleanup
    return () => {
      window.removeEventListener('resize', handleResize);
      if (container && renderer.domElement) {
        container.removeChild(renderer.domElement);
      }
      silkRibbons.forEach(ribbon => {
        ribbon.geometry.dispose();
        ribbon.mesh.material.dispose();
      });
      renderer.dispose();
    };
  }, []);

  return (
    <div
      ref={containerRef}
      style={{
        position: 'absolute',
        top: '50%',
        left: 0,
        width: '100%',
        height: '50%',
        zIndex: 0,
        pointerEvents: 'none',
        overflow: 'hidden'
      }}
    />
  );
};

export default WaveBackground;
